import { Redirect } from 'react-router-dom'

class Checkout extends React.Component {
    constructor(props){
        super(props)
        this.state = {

        }
    }
    render () {
        if ( !this.props.auth.uid ) {
            return (
                <Redirect to='/signin' />
            )
        }

        return (
            <div className='container' >
                    <form className='teal lighten-5 z-depth-2'>
                        <h5 className='grey-text text-darken-3'> Sign Up</h5>
                        <div className='input-field'>
                            <label htmlFor='cardNumber'>Card number</label>
                            <input type='text' id='cardNumber' onChange={this.handleChange} />
                        </div>

                        <div className='input-field'>
                            <label htmlFor='nameOnCard'>Name on card</label>
                            <input type='text' id='nameOnCard' onChange={this.handleChange} />
                        </div>

                        <div className='input-field'>
                            <label htmlFor='expiration'>Expiraion</label>
                            <input type='text' id='expiration' onChange={this.handleChange} />
                        </div>

                        <div className='input-field'>
                            <label htmlFor='password'>CVC</label>
                            <input type='password' id='password' onChange={this.handleChange} />
                        </div>

                        <div className='input-field'>

                        </div>

                    </form>
                </div>
        )
    }
}

export default Checkout
